import React from "react";
import {
  PageContainer,
  ContentContainer1,
  Title,
} from "./styles/about_style.js";
import Card from "../components/card";

function About() {
  return (
    <>
      <PageContainer>
        <ContentContainer1>
          <Title>Building Tomorrow's Maritime Frontier</Title>
        </ContentContainer1>
      </PageContainer>
    </>
  );
}

export default About;
